import { t } from 'i18next';
import './about.css'

export default function About(props) {
    let url = "#";

    return (
        <div onClick={() => props.clickHandler()} className="cardboard">
            <br />
            <br />
            <br />
            <br />
            <br />
            <span style={{fontSize:"3em"}}>{t('appPageTexts.part7')}</span>
            <span style={{fontSize:"2em"}}>{t('appPageTexts.part7')}
                <p>BiblioPDF is a java web application for handling bibliographic materials, as papers, books, even code.</p>
                <p>The frontend will be developed using REACT and the backend will ultimately be developed with some flavor of Spring, Spring-JPA on PostgreSQL.</p>
                <p>Although this app should be useful, it will mostly serve as a technology demonstration.</p>
            </span>
        </div>
    );
}
